import React from 'react'
import Link from 'next/link'

import Layout from '../components/layout'

const DetailLink = props => (
  <Link href="/detail/[id]" as={`/detail/${props.id}`}>
    <a>{props.id}</a>
  </Link>
)

const Detail = () => {
  return (
    <Layout>
      <p>Hello Next.js</p>
    </Layout>
  );
}

export default Detail
